import React, {useState} from "react";
import "./NewExpenseButton.css";

const NewExpenseButton=(props)=>{
    const [NewExpenseButtonStatus,SetNewExpenseButtonStatus]=useState(false);

    const ClickHandler=()=>{
        SetNewExpenseButtonStatus(NewExpenseButtonStatus+1);
        console.log(NewExpenseButtonStatus);
    }

    return (<div className="new-expense">
        <button className="new-expense button" onClick={ClickHandler}> Add New Expence.</button>
    </div>);
}

export default NewExpenseButton;
